import React from 'react'; 
import './Profile.css'

function Profile() {
    return(
        <div className="profileInfo"> 
            <div className="profileContent">
                <h1>name : Deokhaeng "Duck" Lee</h1>
                <h2>bio: "el psy congroo"</h2>
            </div>
        </div>
    );
}

export default Profile;
